import React from 'react';
import { Link } from 'react-router-dom';
import './style.css'


const Layout = (props) => {
    return (
        <div>
            <div>
                <navbar>
                    <Link to={'/'}>
                        Home Page
                    </Link>
                    <br />
                    <Link to={'/contacts'}>
                        Contacts
                    </Link>
                    <br />
                    <Link to={'/blogs'}>
                        Blogs
                    </Link>
                </navbar>
            </div>
            <div>
                {props.children}
            </div>
        </div>
    );
}

export default Layout;
